import React from "react";
import Search from "../common/search";
import { Alert } from "antd";
import { useStore } from "../../util/store/mycontext";
import "./home.scss";

function Home() {
  return (
    <div className="home">
      <Alert message="Error Text" type="error" />

      <Search
        placeholder={"Search for a movie, tv show, ..."}
        inputValue={""}
      />
    </div>
  );
}

export default Home;
